import PropTypes from 'prop-types';
import React from "react";
import { Link } from "react-router-dom";
import {Nav, NavDropdown, Navbar} from "react-bootstrap";
import { Dropdown, Menu } from 'semantic-ui-react';

const options = [
  { key: 1, text: 'Choice 1', value: 1 },
  { key: 2, text: 'Choice 2', value: 2 },
  { key: 3, text: 'Choice 3', value: 3 },
]

function HeaderNavbar() {

  return (
    <Navbar id="navbar-bg" collapseOnSelect expand="md">
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="row navbar-center">
          <div className="col">
          </div>
          <div className="col">
            <Nav.Link as={Link} to="/home">Startseite</Nav.Link>
          </div>
          <div className="col">
            <Dropdown onMouseOver="this.style.color='#0F0'" text={<Link className="dropdown-style" to="/services" >Leistungen</Link>} options={options} simple item />
          </div>
          <div className="col">
            <Nav.Link as={Link} to="/aboutMe">Ãœber mich</Nav.Link>
          </div>
          <div className="col">
            <Nav.Link as={Link} to="/contact">Kontakt</Nav.Link>
          </div>
          <div className="col">
          </div>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default HeaderNavbar;
